webpackJsonp([0x61d15d102e6c],{1526:function(a,e){a.exports={data:{markdownRemark:{html:'<p>誰かが教えてくれた： "あなたの学生（今は先生）の1人が、私がWang Huningの本を読んでいないという大学院生に言いました。"米国に対するアメリカの反対は、最高の書かれた（それを見たくないという意味です）と聞きました。生徒はたくさん反応しました。</p>\n<p>そんなことがあると思いますが、そのようなことを言う人は、結局は他の人たちによって冗談になるでしょう。有名な有名人を倒すことは、この世界の中での論理です。何人かの人々は「怒っている」、彼らは本を書かず、他の人の本は目を引くものではありません。何人かの人々が自己養育者の功績ではなく、自分自身を育てている人もいますが、後で彼が話す人もいれば、中国人の学習方法はわかりません。</p>\n<p>私がこれを聞いたとき、瞬時に迷惑がかかり、栽培が不十​​分であることが示されました。学習のことはすべて社会に貢献しています。彼らは軽く自分自身の外にあり、他の人たちがどう言うか気にしません。</p>\n<p>しかし、それが自分自身の学生であれば、それは厳しいものではないことを意味します。</p>',id:"/home/swain/workspace/political-life/src/pages/ja/0174.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0174.md",frontmatter:{title:"11月1日 火曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0174.md absPath of file >>> MarkdownRemark"}}}});
